@Life Fun These people nearly all had a terminal disease and would have died within months anyway.

The number of people that died of Covid (instead of with covid while dying of cancer) is far lower than 22k and more in the region of several hundred. And these were not even elderly, but among all age groups.

The flu's of 2018 killed more people.

